// import logo from './logo.svg';
import './App.css';
import { Card, /*Image*/ Icon } from 'semantic-ui-react'
import { FiInstagram } from "react-icons/fi";
import { FiLinkedin } from "react-icons/fi";
import { FiGithub } from "react-icons/fi";

// import {center} from "./assets/center.png";
// import {yellowcircle} from "./assets/Ellipse1.png";
// import {Ellipse2} from "./assets/Ellipse2.png";
// import {} from "src/assets";
// import {} from "src/assets";
// import {} from "src/assets";
// import {} from "src/assets";
// import {} from "src/assets";
// import {} from "src/assets";

const styleLink = document.createElement("link");
styleLink.rel = "stylesheet";
styleLink.href = 
"https://cdn.jsdelivr.net/npm/semantic-ui/dist/semantic.min.css";
document.head.appendChild(styleLink);

function App() {
  return (
    <div className="App">

   <div className="Home">
      <p className="Home_intro">My name is Siddhi Dhamale.<br/>
       Analyst,Deloitte.<br/>

       I am passionate about learning new things, <br/>
       experimenting with new technologies, <br/>
       and sharing my knowledge with others. </p>

       <div className='Home_imgs'>
      <img className='yellowCircle' src={require('./assets/Ellipse1.png')} alt=""></img>
      <img className='whitecircle' src={require('./assets/Ellipse2.png')} alt=""></img>
      <img className='center'src={require('./assets/center.png')} alt=""></img>

      <img className='java' src={require('./assets/java.png')} alt=""></img>
      <img className='programmer' src={require('./assets/programmer.png')} alt=""></img>
      <img className='scifi'src={require('./assets/sci-fi.png')} alt=""></img>
      <img className='git'src={require('./assets/th.jpeg')} alt=""></img>
      <img className='html'src={require('./assets/html element.png')} alt=""></img>
       </div>
   </div>    

    <div className="Projects">
      <h4 className="Title" >Projects</h4>
      <div className="Projects_cardView">
      <Card.Group stackable className='Cards'>
        <Card>
      <Card.Content>
      <Card.Header>Wallpaper App</Card.Header>
      <Card.Meta>
        <span>Download wallpapers.<br></br>
          I am passionate about learning new things</span>
      </Card.Meta>
    </Card.Content>
    <Card.Content extra>
        <Icon name='LINK' />LINK
    </Card.Content>
  </Card>
  <Card>
      <Card.Content>
      <Card.Header>Wallpaper App</Card.Header>
      <Card.Meta>
        <span>Download wallpapers.<br></br>
          I am passionate about learning new things</span>
      </Card.Meta>
    </Card.Content>
    <Card.Content extra>
        <Icon name='LINK' />LINK
    </Card.Content>
  </Card>
  <Card>
      <Card.Content>
      <Card.Header>Wallpaper App</Card.Header>
      <Card.Meta>
        <span>Download wallpapers.<br></br>
          I am passionate about learning new things</span>
      </Card.Meta>
    </Card.Content>
    <Card.Content extra>
        <Icon name='LINK' />LINK
    </Card.Content>
  </Card>
  <Card>
      <Card.Content>
      <Card.Header>Wallpaper App</Card.Header>
      <Card.Meta>
        <span>Download wallpapers.<br></br>
          I am passionate about learning new things</span>
      </Card.Meta>
    </Card.Content>
    <Card.Content extra>
        <Icon name='LINK' />LINK
    </Card.Content>
  </Card>

  </Card.Group>
      </div>
    </div>

    <div className="Contact">
    <h4 className="Title" >Contact</h4>
    <div className="Contact_logo">
     <a href="http://"> <FiInstagram className='Contact_logo1'/>
     </a>
     <a href="http://">  <FiLinkedin className='Contact_logo1'/> </a>
     <a href="http://"> <FiGithub className='Contact_logo1'/> </a>
    {/* <img src={linkedin} alt=""></img>
    <img src={insta}></img>
    <img src={th}></img> */}

    </div>
    </div>

    </div>

  );
}

export default App;
